    ["title Mouse - Possible Collision Warning\n\nmouse_left L\nmouse_right R\n\n========\nOBJECTS\n========\n\nbackground .\nblack\n\nplayer\ngreen\n\nL\npink\n\nR\npurple\n\n=======\nLEGEND\n=======\n\n=======\nSOUNDS\n=======\n\n================\nCOLLISIONLAYERS\n================\nbackground\nplayer\nL R\n\n======\nRULES\n======\n\n==============\nWINCONDITIONS\n==============\n\n=======\nLEVELS\n=======\n.\n",["Mouse object 'l' (for input 'mouse_left') could overlap with other objects on the same layer. Consider moving the object to its own layer.","Mouse object 'r' (for input 'mouse_right') could overlap with other objects on the same layer. Consider moving the object to its own layer."],0]
