    ["title The haunted vending machine\nauthor Oskar van Deventer Puzzlescript by Andrea Gilbert\nhomepage https://www.clickmazes.com\nagain_interval 0.1\nrun_rules_on_level_start\n\n(puzzlescript-plus)\nmouse_left click\ntween_length 0.1 (animate the coin drop)\nsprite_size 9\nlevel_select\ncontinue_is_level_select\nlevel_select_solve_symbol V\ntext_controls Click or tap to drop a coin \\nZ for undo and R for restart\n\n========\nOBJECTS\n========\n\nBackground\nwhite\nEdge\n#DDD\n\ncoin (player)\nyellow orange orange orange\n.........\n.........\n...111...\n..12001..\n.1222001.\n.3222203.\n.3222223.\n..33333..\n...333...\n\nslot copy:coin\n#EEE #EEE #EEE red\n\nGtopL\ngreen green green transparent black\n33.......\n322111111\n.22211111\n.1200....\n.11000...\n.11.000..\n.11..000.\n.11...004\n.11....44\n\nGtopR\ngreen green green transparent black\n.......33\n111111223\n11111222.\n....0021.\n...00011.\n..000.11.\n.000..11.\n400...11.\n44....11.\n\nRtopL copy:GtopL\nred red red transparent black\n\nRtopR copy:GtopR\nred red red transparent black\n\ntailR copy:GtopL\nblack transparent black black transparent\n\ntailL copy:GtopR\nblack transparent black black transparent\n\nboxL\n#AAA\n0........\n0........\n0........\n0........\n0........\n0........\n0........\n0........\n0........\nboxR\n#AAA\n........0\n........0\n........0\n........0\n........0\n........0\n........0\n........0\n........0\n\nBar\n#EEE\n.0.0.0.0.\n.........\n.........\n.........\n.........\n.........\n.........\n.........\n.........\n\nfall\ntransparent\nflip\ntransparent\nfeed\ntransparent\nbump\ntransparent\ninit\ntransparent\nclick\nblue\n\n=======\nLEGEND\n=======\n\n. = Background\nz = bar\nx = edge\n? = init\n\nplayer = coin\n\na = GtopR\nb = GtopL\nc = tailL\nd = tailR\ne = RtopR\nf = RtopL\ni = coin\n\ns = slot and feed\n\nempty = GtopR or GtopL \ntopG = GtopR or GtopL\ntopL = GtopL or RtopL\ntopR = GtopR or RtopR\ntop = topL or topR\ntail = tailL or tailR\nswitch = top or tail\nbox = boxL or boxR\n\n=======\nSOUNDS\n=======\n\nendlevel 35598103\nsfx0 41861900 (flip)\nsfx1 7789500 (coin drop)\nsfx2 47730303 (bump)\n\n================\nCOLLISIONLAYERS\n================\n\nBackground\nbox\nclick\nslot\nbar, edge\nswitch\ncoin (player)\nflip, feed, bump\nfall, init\n\n======\nRULES\n======\n\n(ignore player movement triggered by the cursor keys)\n[ > player ] -> cancel\n\n(init) (randomise the switches)\ndown [ init no switch | ] -> [ init random topG | init tailL ]\nright [ init GtopR | ] -> [ | GtopR ]\ndown [ init GtopL | init tailL ] -> [ GtopL | init flip tailL ] \nright [ init tailL flip | ] -> [ | tailR ]\n[init] -> []\n\n(draw boxes around switches)\ndown [ | | topL no box | ] -> [ boxL | boxL | boxL topL | boxL ]\ndown [ | | | tailR no box ] -> [ boxR | boxR | boxR | boxR tailR ]\ndown [ | | topR no box | ] -> [ boxR | boxR | boxR topR | boxR ]\ndown [ | | | tailL no box ] -> [ boxL | boxL | boxL | boxL tailL ]\nright [ boxR | no boxL ] -> [ boxR | boxL ]\nleft [ boxL | no boxR ] -> [ boxL | boxR ]\n\n(set all falling coins in motion)\ndown [ coin fall | no top ] -> [ > coin > fall | ] \n(bump falling coin sideways off a stationary coin)\ndown [ > coin | stationary coin ] -> [ coin bump | stationary coin ]\nright [ boxL coin bump | ] -> [ boxL > coin | ] sfx2\nleft [ boxR coin bump | ] -> [ boxR > coin | ] sfx2\n(detect a flip event)\ndown [ > coin > fall | tail ] -> [ > coin > fall flip | tail ] sfx0\n(propogate flip event)\ndown [ coin flip | tail no flip ] -> [ coin flip | tail flip ]\nright [ coin flip | topR ] -> [ coin | topR flip ] \nleft [ coin flip | topL ] -> [ coin | topL flip ] \n(activate flip)\nright [ topL flip ] -> [ > GtopR ]\nleft [ topR flip ] -> [ > GtopL ]\nright [ tailL flip ] -> [ > tailR ]\nleft [ tailR flip ] -> [ > tailL ]\n\n(=== engine applies movement ===)\n\n(click to drop a coin)\nlate [ click no slot ] -> []\nlate [ click slot no coin ] -> [ slot coin fall ] sfx1\n\n(update colour of switch)\nlate down [ coin | GtopR ] -> [ coin | RtopR ]\nlate down [ coin | GtopL ] -> [ coin | RtopL ]\n\n(destroy lost coins)\nlate [ coin fall edge ] -> [ edge ]\n\n(if any coin is still falling - repeat)\nlate down [ coin fall | top ] -> [ coin | top ]\nlate down [ coin no fall | no top no bar ] -> [ coin fall | ]\n\nlate [ fall no coin ] -> []\nlate [ coin fall ] -> again\n\n==============\nWINCONDITIONS\n==============\n\nno empty\nno fall\n\n=======\nLEVELS\n=======\n\nsection Intro & Tutorial levels\n\nMessage Completely fill the vending machine with coins\nMessage Tutorial levels: Insert 2/3/4 coins\n\nxxxxxxx \nx.s.s.x\nxzzzzzx\nx.....x\nx.....x\nx.?...x\nx.....x\nx.....x\nx.....x\nx..?..x\nx.....x\nx.....x\nxxxxxxx\n\nxxxxxxx \nx.ss..x\nxzzzzzx\nx.....x\nx.....x\nx.?...x\nx.....x\nx.....x\nx.....x\nx..?..x\nx.....x\nx.....x\nx.....x\nx.?...x\nx.....x\nx.....x\nxxxxxxx\n\nxxxxxxxx \nx..sss.x\nxzzzzzzx\nx......x\nx......x\nx..?...x\nx......x\nx......x\nx......x\nx.?.?..x\nx......x\nx......x\nx......x\nx..?...x\nx......x\nx......x\nxxxxxxxx\n\nMessage The orientation of all flippers is randomised at start or restart\n\nsection Insert 5 coins\n\nxxxxxxxxxx\nx..ss.s..x\nxzzzzzzzzx\nx........x\nx........x\nx.?...?..x\nx........x\nx........x\nx........x\nx..?.?...x\nx........x\nx........x\nx........x\nx...?....x\nx........x\nx........x\nxxxxxxxxxx\n\nsection Insert 6 coins\n\nxxxxxxxxxx\nx..sss...x\nxzzzzzzzzx\nx........x\nx........x\nx..?.....x\nx........x\nx........x\nx........x\nx.?.?....x\nx........x\nx........x\nx........x\nx..?.?...x\nx........x\nx........x\nx........x\nx...?....x\nx........x\nx........x\nxxxxxxxxxx\n\nsection Insert 7 coins\n\nxxxxxxxxxx\nx..ssss..x\nxzzzzzzzzx\nx........x\nx........x\nx..?.?...x\nx........x\nx........x\nx........x\nx.?.?.?..x\nx........x\nx........x\nx........x\nx..?.?...x\nx........x\nx........x\nxxxxxxxxxx\n\nsection Insert 8 coins\n\nxxxxxxxxxxx\nx..ssss...x\nxzzzzzzzzzx\nx.........x\nx.........x\nx..?.?....x\nx.........x\nx.........x\nx.........x\nx.?...?...x\nx.........x\nx.........x\nx.........x\nx..?...?..x\nx.........x\nx.........x\nx.........x\nx...?.?...x\nx.........x\nx.........x\nxxxxxxxxxxx\n\nsection Insert 9 coins\n\nxxxxxxxxxxx\nx...ssss..x\nxzzzzzzzzzx\nx.........x\nx.........x\nx..?.?.?..x\nx.........x\nx.........x\nx.........x\nx...?.?...x\nx.........x\nx.........x\nx.........x\nx....?....x\nx.........x\nx.........x\nx.........x\nx.?.?.?...x\nx.........x\nx.........x\nxxxxxxxxxxx\n\nsection Insert 10 coins\n\nxxxxxxxxxxxx\nx..ssssss..x\nxzzzzzzzzzzx\nx..........x\nx..........x\nx..?.?.?...x\nx..........x\nx..........x\nx..........x\nx.?.?.?.?..x\nx..........x\nx..........x\nx..........x\nx..?.?.?...x\nx..........x\nx..........x\nxxxxxxxxxxxx\n\nsection Insert 11 coins\n\nxxxxxxxxxxx\nx..sssss..x\nxzzzzzzzzzx\nx.........x\nx.........x\nx..?.?.?..x\nx.........x\nx.........x\nx.........x\nx.?.?.?...x\nx.........x\nx.........x\nx.........x\nx..?.?.?..x\nx.........x\nx.........x\nx.........x\nx...?.?...x\nx.........x\nx.........x\nxxxxxxxxxxx\n\nsection Insert 12 coins\n\nxxxxxxxxxxx\nx.ss.sss..x\nxzzzzzzzzzx\nx.........x\nx.........x\nx..?.?.?..x\nx.........x\nx.........x\nx.........x\nx.?.?.?...x\nx.........x\nx.........x\nx.........x\nx..?.?.?..x\nx.........x\nx.........x\nx.........x\nx.?.?.?...x\nx.........x\nx.........x\nxxxxxxxxxxx\n\nMessage Thank-you for playing! :)\n\n(unit-tests to accompany bug fixes)\n(#1: reported by Heiegg: 24/06/22)\n(xxxxxxxxxxxxxxxx\nx.s............x\nxzzzzzzzzzzzzzzx\nx..............x\nx...........i..x\nx.........i.i..x\nx.......i.i.i..x\nx.....i.i.i.i..x\nx...i.i.i.i.i..x\nx.i.i.i.i.i.i..x\nx..............x\nx..............x\nx..............x\nx..a.a.a.a.a.a.x\nx.c.c.c.c.c.c..x\nx..............x\nx..............x\nx..............x\nxxxxxxxxxxxxxxxx\n(#1: reported by Heiegg: 24/06/22)\nxxxxxxxxxxx\nx.ss.sss..x\nxzzzzzzzzzx\nx.........x\nx....i....x\nx...af.b..x\nx..c..d.d.x\nx.........x\nx....ii...x\nx.b..ef...x\nx..dc..d..x\nx.........x\nx......i..x\nx...a.af..x\nx..c.c..d.x\nx.........x\nx.....i...x\nx.b.b.f...x\nx..d.d.d..x\nx.........x\nxxxxxxxxxxx)\n",["Using tweens in a game that also has LATE rules is currently experimental! If you change objects that moved with LATE then tweens might not play!"],1]
